function getColorFromKeyword(label) {
  const colors = {
    green: "rgb(63,193,64)",
    blue: "rgb(66, 132, 237)",
    purple: "rgb(199, 56, 198)",
    pink: "rgb(205, 96, 105)",
    hotpink: "rgb(250, 39, 142)",
    lavender: "rgb(198, 123, 218)",
    orange: "rgb(255, 109, 17)",
    magenta: "rgb(241, 137, 220)",
    gold: "rgb(240, 170, 9)",
    violet: "rgb(124, 77, 255)",
    teal: "rgb(0, 190, 196)",
    gray: "rgb(169, 169, 170)",
  };
  return colors[label] || "inherit";
}

/* keywords */
function highlightKeywords(text) {
  return text
    .replace(/(I['â€™` ]?m sorry)/gi, '<keyword data-color="rgb(66,132,237)">$1</keyword>')
    .replace(/(sorry)/gi, '<keyword data-color="rgb(66,132,237)">$1</keyword>')
    .replace(/(I miss you)/gi, '<keyword data-color="rgb(66,132,237)">$1</keyword>')
    .replace(/(I have missed you)/gi, '<keyword data-color="rgb(199,56,198)">$1</keyword>')
    .replace(/(I love you)/gi, '<keyword data-color="rgb(205,96,105)">$1</keyword>')
    .replace(/(I loved you)/gi, '<keyword data-color="rgb(205,96,105)">$1</keyword>')
    .replace(/(in love)/gi, '<keyword data-color="rgb(205,96,105)">$1</keyword>')
    .replace(/(I've always loved)/gi, '<keyword data-color="rgb(205,96,105)">$1</keyword>')
    .replace(/(my true love)/gi, '<keyword data-color="rgb(205,96,105)">$1</keyword>')
    .replace(/(I fell in love with you)/gi, '<keyword data-color="rgb(205,96,105)">$1</keyword>')
    .replace(/(love)/gi, '<keyword data-color="rgb(250,39,142)">$1</keyword>')
    .replace(/(I've loved)/gi, '<keyword data-color="rgb(205,96,105)">$1</keyword>')
    .replace(/\b(home)\b/gi, '<keyword data-color="rgb(198,123,218)">$1</keyword>')
    .replace(/(friends)/gi, '<keyword data-color="rgb(255,109,17)">$1</keyword>')
    .replace(/(I'm leaving you)/gi, '<keyword data-color="rgb(241,137,220)">$1</keyword>')
    .replace(/(letting him go)/gi, '<keyword data-color="rgb(66,132,237)">$1</keyword>')
    .replace(/(letting her go)/gi, '<keyword data-color="rgb(66,132,237)">$1</keyword>')
    .replace(/(my heart)/gi, '<keyword data-color="rgb(199,56,198)">$1</keyword>')
    .replace(/(forever)/gi, '<keyword data-color="rgb(240,170,9)">$1</keyword>')
    .replace(/\b(me)\b/gi, '<keyword data-color="rgb(199,56,198)">$1</keyword>')
    .replace(/\b(you)\b/gi, '<keyword data-color="rgb(124,77,255)">$1</keyword>')
    .replace(/\b(us)\b/gi, '<keyword data-color="rgb(250,39,142)">$1</keyword>')
    .replace(/\b(we)\b/gi, '<keyword data-color="rgb(0,190,196)">$1</keyword>');
}



function makeLinks() {
  db.collection("entries")
    .orderBy("timestamp", "desc")
    .onSnapshot((snapshot) => {
      $("#container").empty();

      snapshot.forEach((doc) => {
        const data = doc.data();
        const labels = data.label || [];

        if (!labels.includes("404-error")) return;

        function waveifyWithKeywords(rawText) {
          const highlighted = highlightKeywords(rawText);
          const container = document.createElement("div");
          container.innerHTML = highlighted;
        
          function wrapNode(node) {
            if (node.nodeType === Node.TEXT_NODE) {
              return node.textContent.split("").map(char => {
                const span = document.createElement("span");
                span.className = "hover-letter";
                span.innerHTML = `${char}<button class="pick-me-btn" style="display: none;">Pick me</button>`;
                return span;
              });
            } else if (node.nodeType === Node.ELEMENT_NODE) {
              const color = node.getAttribute("data-color");
              return Array.from(node.childNodes).flatMap(child => {
                return wrapNode(child).map(wrapped => {
                  if (color) wrapped.style.color = color;
                  return wrapped;
                });
              });
            } else {
              return [];
            }
          }                 
        
          const result = Array.from(container.childNodes)
            .flatMap(wrapNode)
            .map(el => el.outerHTML)
            .join("");
        
          return result;
        }
        

        const messageLines = (data.message || "").split("\n");
        const timestamp = data.timestamp?.toDate?.().toLocaleString() || "No timestamp";

        const $box = $(`
          <div class="entry-box">
            <div class="entry-message">
              <div class="entry-subject">${data["subject line"] || ""}</div>
              <div class="flower-text">
                ${messageLines.map(line => `<div class="message-line">${waveifyWithKeywords(line)}</div>`).join("")}
              </div>
            </div>
            <div class="entry-meta-side">
              <div class="meta-id">${data.number || ""}</div>
              <div class="meta-title">${data["subject line"] || ""}</div>
              <div class="meta-author">${data.author || ""}</div>
              <div class="meta-timestamp">${timestamp}</div>
            </div>
          </div>
        `);
        

        $("#container").append($box);
      });

      addHoverEffects(); // apply after all are added
    });
}

const colorPalette = [
  "rgb(240, 170, 9)",
  "rgb(241, 137, 220)",
  "rgb(198, 123, 218)",
  "rgb(250, 39, 142)",
  "rgb(63, 193, 64)",
  "rgb(255, 109, 17)",
  "rgb(66, 132, 237)",
  "rgb(199, 56, 198)",
  "rgb(0, 190, 196)",
  "rgb(124, 77, 255)",
];

function getRandomColorFromPalette() {
  const index = Math.floor(Math.random() * colorPalette.length);
  return colorPalette[index];
}

function addHoverEffects() {
  document.querySelectorAll('.hover-letter').forEach(span => {
    const btn = span.querySelector('.pick-me-btn');

    span.addEventListener('mouseenter', () => {
      const color = getRandomColorFromPalette();
      span.style.color = color;
      span.setAttribute('data-color', color); // store for later use
      btn.style.display = "block";
    });

    span.addEventListener('mouseleave', () => {
      // Do not reset the color; just hide the button.
      btn.style.display = "none";
    });

    btn.addEventListener('click', (e) => {
      e.stopPropagation();
    
      const pickedChar = span.childNodes[0].textContent;
    
      const pickedLettersNew = document.getElementById("picked-letters-new");
      const pickedLettersGrid = document.getElementById("picked-letters-grid");
    
      // If there's already a big letter showing, move it down into the grid.
      if (pickedLettersNew.firstChild) {
        const previousBigLetter = pickedLettersNew.firstChild;
        previousBigLetter.classList.remove("picked-letter-new");

        // Insert the previous big letter at the top of the grid.
        if (pickedLettersGrid.firstChild) {
          pickedLettersGrid.insertBefore(previousBigLetter, pickedLettersGrid.firstChild);
        } else {
          pickedLettersGrid.appendChild(previousBigLetter);
        }
      }
    
      // Now add the new big letter.
      const pickedLetter = document.createElement("div");
      pickedLetter.textContent = pickedChar;
      pickedLetter.classList.add("picked-letter", "picked-letter-new");
      pickedLetter.style.color = span.getAttribute("data-color") || "inherit";
    
      pickedLettersNew.innerHTML = "";
      pickedLettersNew.appendChild(pickedLetter);
    
      // Clear the picked letter from the message.
      span.innerHTML = "&nbsp;";
      span.classList.remove("hover-letter");
      span.style.color = "transparent";
      span.style.pointerEvents = "none";
    });
  });
}


$(document).ready(function () {
  let isAboutInFront = false;

  $("#about-overlay").on("click", function () {
    isAboutInFront = !isAboutInFront;
    $(this).css("z-index", isAboutInFront ? 10000 : 0);
  });

  makeLinks();

  $("#close-thank-you").on("click", function () {
    $("#thank-you-popup").fadeOut(100);
  });

  $("#submission-form").on("submit", async function (e) {
    e.preventDefault();

    const subject = $('input[name="subject line"]').val().trim();
    const author = $('input[name="author"]').val().trim();
    const message = $('textarea[name="message"]').val().trim();
    const labels = $('input[name="label"]:checked');

    let hasError = false;
    if (!subject) { $("#error-subject").text("Required"); hasError = true; }
    if (!author) { $("#error-author").text("Required"); hasError = true; }
    if (!message) { $("#error-message").text("Required"); hasError = true; }
    if (labels.length === 0) { $("#error-label").text("Choose one"); hasError = true; }

    if (hasError) return;

    try {
      const snapshot = await db.collection("entries").orderBy("timestamp", "desc").get();
      const newNumber = String(snapshot.size + 1).padStart(3, "0");

      const formData = {
        "subject line": subject,
        author: author,
        message: message,
        label: Array.from(labels).map(cb => cb.value),
        number: newNumber,
        timestamp: new Date()
      };

      await db.collection("entries").add(formData);
      this.reset();
      $("#thank-you-popup").fadeIn(200);
    } catch (err) {
      console.error("Error submitting:", err);
    }
  });

  $("#about-overlay").css("z-index", 0);
});

// Prevent picked-letters scroll from bubbling to the main page
document.getElementById('picked-letters-scroll').addEventListener('wheel', function(event) {
  event.stopPropagation();
}, { passive: false });


/* close/open toggle */
const toggleButton = document.getElementById('close-picked-letters');
const pickedLettersElements = [
  document.getElementById('picked-letters-bg'),
  document.getElementById('picked-letters-grid'),
  document.getElementById('picked-letters-new'),
  document.getElementById('button-row')
];

toggleButton.addEventListener('click', () => {
  const isVisible = pickedLettersElements[0].style.display !== 'none';

  pickedLettersElements.forEach(el => {
    el.style.display = isVisible ? 'none' : '';
  });

  toggleButton.textContent = isVisible ? 'Show' : 'Hide';
});


/* clear grid button */
document.getElementById('clear-button').addEventListener('click', () => {
  const newContainer = document.getElementById('picked-letters-new');
  const gridContainer = document.getElementById('picked-letters-grid');

  // Clear both containers
  newContainer.innerHTML = '';
  gridContainer.innerHTML = '';
});

/* print settings */
document.getElementById('print-button').addEventListener('click', function () {
  const printButton = this;

  printButton.textContent = "Preparing your print...";
  printButton.disabled = true;
  printButton.style.opacity = "0.6";

  setTimeout(() => {
    const pickedNew = Array.from(document.querySelector('#picked-letters-new').children);
    const pickedGrid = Array.from(document.querySelector('#picked-letters-grid').children);
    const pickedLetters = [...pickedNew, ...pickedGrid];
      
    const rows = 11;
    const cols = 3;
    const totalSlots = rows * cols;

    // Fill with blanks if fewer than 45 letters
    while (pickedLetters.length < totalSlots) {
      const emptyDiv = document.createElement('div');
      emptyDiv.classList.add('picked-letter');
      emptyDiv.innerHTML = '&nbsp;';
      pickedLetters.push(emptyDiv);
    }

    // Initialize columns
    const columns = [[], [], []];

    // Assign elements DOWN the columns first
    for (let i = 0; i < pickedLetters.length; i++) {
      const colIndex = i % cols;        // 0, 1, 2
      columns[colIndex].push(pickedLetters[i]);
    }

    // Now re-flatten it: row by row down each column
    let arranged = '';
    for (let row = 0; row < rows; row++) {
      for (let col = 0; col < cols; col++) {
        arranged += columns[col][row]?.outerHTML || '';
      }
    }

    const printContent = `
      <html>
        <head>
          <title>Print Picked Letters</title>
          <style>
            @font-face {
              font-family: 'Flowers';
              src: url('https://enyajpan.github.io/404-error/assets/pixel-flowers.ttf') format('truetype');
            }

            @page {
              size: landscape;
              margin: 0;
            }

            body {
              background: url('data:image/png;base64,') no-repeat center center;
              font-family: 'Flowers', sans-serif;
              font-size: 4rem;
              text-align: center;
              margin: 0;
              padding: 0;
              background-size: contain;
              background-repeat: no-repeat;
              background-position: top;
              width: 11in;
              height: 8.5in;
              overflow: hidden;
              position: relative;
            }

            #print-container {
              display: grid;
              grid-template-columns: repeat(3, 1fr);
              grid-template-rows: repeat(11, 1fr); 
              row-gap: 2px;
              column-gap: 4px;
              position: absolute;
              top: 4%;
              right: 16%;
              bottom: 5%;
              width: 40%;
              height: 100%;
              padding: 1in;
              box-sizing: border-box;
              z-index: 1;
            }

            .picked-letter, .picked-letter-new {
              font-size: 4rem;
              text-align: center;
              line-height: 0.89;
            }
          </style>
        </head>
        <body>
          <div id="print-container">
            ${document.getElementById('picked-letters-new').innerHTML}
            ${document.getElementById('picked-letters-grid').innerHTML}
          </div>
        </body>
      </html>
    `;

    const printWindow = window.open('', '', 'width=1200,height=900');
    printWindow.document.open();
    printWindow.document.write(printContent);
    printWindow.document.close();
    printWindow.focus();

    // Delay print slightly to let layout/render finish
    setTimeout(() => {
      printWindow.print();
      printWindow.close();
    }, 250);


    printButton.textContent = "Take Away";
    printButton.disabled = false;
    printButton.style.opacity = "1";
  }, 600);
});




